import React from 'react';
import ProfessorSearchPage from './ProfessorSearchPage'; // 假设你的组件路径是正确的
import NavBar from '../navBar/NavBar';

function Search({ location }) {
  const { professors } = location.state || {};

  return (
    <div className="App">
      <NavBar/>
      <ProfessorSearchPage professors={professors} />
    </div>
  );
}

export default Search;
